text:
all beautiful things carry the distinction of imperfection. your wounds and imperfections are your beauty. like the broken pottery mended with gold, we are all kintsugi.
/////
the kintsugi philosophy and art state that breakage and mending are honest parts of a past which should not be hidden. your wounds and your healing are a part of your history; a part of who you are.
/////
everything that is beautiful has also been damaged. the most beautiful people we have known are those that have known defeat, known suffering, known struggle, known loss, and yet have still found their way out of the depths. they have an appreciation, a sensitivity, and an understanding of life that fills them with compassion, gentleness, and a deep loving concern.
/////
beautiful people do not just happen. they are forged; and they are precious.
/////
paraphrased via #bryantmcgill and #elizabethkublerross
/////
#whyididntreport #metoo #kitsugiphilosophy #kitsugicounseling #kitsugi #brokenquotes #brokenbutbeautiful #healingquotes #healingart #ibelieveher #ibelievehim #ibelieveyou

